import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const TabComponent = () => {
  const [activeTab, setActiveTab] = useState('home');

  const handleTabClick = (tabId) => {
    setActiveTab(tabId);
  };

  return (
    <div className="row">
      <div className="col-4">
        <div className="list-group" id="list-tab" role="tablist">
          <a
            className={`list-group-item list-group-item-action ${activeTab === 'home' ? 'active' : ''}`}
            onClick={() => handleTabClick('home')}
            role="tab"
            aria-controls="home"
          >
            Home
          </a>
          <a
            className={`list-group-item list-group-item-action ${activeTab === 'profile' ? 'active' : ''}`}
            onClick={() => handleTabClick('profile')}
            role="tab"
            aria-controls="profile"
          >
            Profile
          </a>
          <a
            className={`list-group-item list-group-item-action ${activeTab === 'messages' ? 'active' : ''}`}
            onClick={() => handleTabClick('messages')}
            role="tab"
            aria-controls="messages"
          >
            Messages
          </a>
          <a
            className={`list-group-item list-group-item-action ${activeTab === 'settings' ? 'active' : ''}`}
            onClick={() => handleTabClick('settings')}
            role="tab"
            aria-controls="settings"
          >
            Settings
          </a>
        </div>
      </div>
      <div className="col-8">
        <div className="tab-content" id="nav-tabContent">
          <div className={`tab-pane fade ${activeTab === 'home' ? 'show active' : ''}`} id="list-home" role="tabpanel" aria-labelledby="list-home-list">
            {/* Content for Home tab */}
          </div>
          <div className={`tab-pane fade ${activeTab === 'profile' ? 'show active' : ''}`} id="list-profile" role="tabpanel" aria-labelledby="list-profile-list">
            {/* Content for Profile tab */}
          </div>
          <div className={`tab-pane fade ${activeTab === 'messages' ? 'show active' : ''}`} id="list-messages" role="tabpanel" aria-labelledby="list-messages-list">
            {/* Content for Messages tab */}
          </div>
          <div className={`tab-pane fade ${activeTab === 'settings' ? 'show active' : ''}`} id="list-settings" role="tabpanel" aria-labelledby="list-settings-list">
            {/* Content for Settings tab */}
          </div>
        </div>
      </div>
    </div>
  );
};

export default TabComponent;
